function App() {
  const {
    theme,
  } = useContext(pocketContext);
  return (
    <header className="App-header row s-btw">
      <h1 style={ { color: theme.color } }>All.Io</h1>
      <DarkLightModeSelector />
    </header>
  );
}

export default App;
